import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";

import { Button, Navbar, Container, Nav, Row, Col } from "react-bootstrap";

let Title = styled.div`
  font-size: 2rem;
  padding: 0.5rem;
  text-align: center;
  background-color: grey;
  border-radius: 1rem;
  width: 50%;
  color: darkgrey;
`;
let CenterBox = styled.div`
  text-align: center;
`;

let MainWrap = styled.div`
  max-width: 1300px;
  margin: auto;
  background: #00457e;
  padding: 1rem;
`;

let Navbars = styled.div`
  text-align: center;
  background: #02315e;
  color: white;
  padding: 1rem;
  font-size: 2rem;
`;

let Searchbox = styled.div`
  text-align: center;
  background: #806491;
  color: grey;
  padding: 0.5rem;
  border-radius: 1rem;
  margin: 1rem;
  font-size: 1.5rem;
  border: none;
`;

let LoginBtn = styled.button`
  text-align: center;
  color: white;
  border-radius: 1rem;
  padding: 0.5rem;
  background: #2f70af;
  float: right;
  font-size: 1rem;
`;

let Feeds = styled.div`
  border-radius: 1rem;
  background: #02315e;
  color: white;
  padding: 0.5rem;
  margin-left: 5rem;
`;

let Contents = styled.div`
  background: #00457e;
  margin: 2rem;
  border-radius: 1rem;
  padding: 2rem;
`;

let SideBar = styled.div`
  float: left;
  border-radius: 1rem;
  background: #02315e;
  width: 4rem;
`;

function App() {
  return (
    <MainWrap className="App">
      <Navbars>
        SNS Music<LoginBtn>로그인</LoginBtn>
      </Navbars>

      <CenterBox>
        <Searchbox>#검색</Searchbox>
      </CenterBox>
      <SideBar>메뉴</SideBar>
      <Feeds>
        <Contents>내용물</Contents>
        <Contents>내용물</Contents>
      </Feeds>
    </MainWrap>
  );
}

export default App;
